import { Card, Table, Space, Form } from 'antd'
import React, { Component } from 'react'
import UserHead from '../../../components/UserHead'
import LinkButton from '../../../components/LinkButton'

export default class TicketList extends Component {

    // 跳转到预定页面
    orderTicket = () => {
        console.log('预定')
    }

    // 条件搜索
    searchTicket=() => {
        
    }

    render() {
        const columns = [
            {
                title: '车次',
                dataIndex: 'trainsNumber',
                key: '1',
                align: 'center',
            },
            {
                title: '起点站',
                dataIndex: 'startStation',
                key: '2',
                align: 'center',
            },
            {
                title: '终点站',
                dataIndex: 'endStation',
                key: '3',
                align: 'center',
            },
            {
                title: '出发时间',
                key: '4',
                dataIndex: 'startDate',
                align: 'center',
            },
            {
                title: '到达时间',
                key: '5',
                dataIndex: 'endDate',
                align: 'center',
            },
            {
                title: '历时',
                key: '6',
                dataIndex: 'consumeTime',
                align: 'center',
            },
            ,
            {
                title: '豪华型',
                key: '7',
                dataIndex: 'luxury',
                align: 'center',
            },
            ,
            {
                title: '普通',
                key: '8',
                dataIndex: 'ordinary',
                align: 'center',
            },
            ,
            {
                title: '经济',
                key: '9',
                dataIndex: 'economic',
                align: 'center',
            },
            {
                title: '操作',
                key: '7',
                render: () => (
                    <Space size="middle">
                        <LinkButton onClick={this.orderTicket}>预定</LinkButton>
                    </Space>
                ),
                align: 'center'
            },
        ];

        const dataSource = [
            {
                key: '1',
                trainsNumber: 'G2121',
                startStation: '成都',
                endStation: '北京',
                startDate: '2021.01.01',
                endDate: '2021.0.0',
                consumeTime: '8',
                luxury: '99',
                ordinary: '99',
                economic: '99',
            },
        ]

        return (
            <div>
                <UserHead />
                <div>
                    <Form name="search-ticket" layout="inline" onFinish={this.searchTicket}>
                        <Form.Item
                            name="startStation"
                        >
                            <Input placeholder="出发地" />
                        </Form.Item>
                        <Form.Item
                            name="endStation"
                        >
                            <Input
                                prefix={<LockOutlined className="site-form-item-icon" />}
                                type="password"
                                placeholder="Password"
                            />
                        </Form.Item>
                        <Form.Item shouldUpdate>
                            {() => (
                                <Button
                                    type="primary"
                                    htmlType="submit"
                                    disabled={
                                        !form.isFieldsTouched(true) ||
                                        !!form.getFieldsError().filter(({ errors }) => errors.length).length
                                    }
                                >
                                    Log in
                                </Button>
                            )}
                        </Form.Item>
                    </Form>
                </div>

                <Card
                    bordered={false}
                >
                    <Table
                        columns={columns}
                        dataSource={dataSource}
                        bordered
                        rowKey="key"
                    />
                </Card>
            </div>
        )
    }
}
